export function transInitials (province) {
  if (province.includes('安徽') || province.includes('澳门')) {
    return 'A'
  } else if (province.includes('北京')) {
    return 'B'
  } else if (province.includes('重庆')) {
    return 'C'
  } else if (province.includes('福建')) {
    return 'F'
  } else if (province.includes('甘肃') || province.includes('广东') || province.includes('广西壮族') || province.includes('贵州')) {
    return 'G'
  } else if (province.includes('海南') || province.includes('河北') || province.includes('河南') || province.includes('黑龙江') || province.includes('湖北') || province.includes('湖南')) {
    return 'H'
  } else if (province.includes('吉林') || province.includes('江苏') || province.includes('江西')) {
    return 'J'
  } else if (province.includes('辽宁')) {
    return 'L'
  } else if (province.includes('内蒙古') || province.includes('宁夏回族')) {
    return 'N'
  } else if (province.includes('青海')) {
    return 'Q'
  } else if (province.includes('山东') || province.includes('山西') || province.includes('陕西') || province.includes('上海') || province.includes('四川')) {
    return 'S'
  } else if (province.includes('天津') || province.includes('台湾')) {
    return 'T'
  } else if (province.includes('西藏') || province.includes('新疆维吾尔') || province.includes('香港')) {
    return 'X'
  } else if (province.includes('云南')) {
    return 'Y'
  } else if (province.includes('浙江')) {
    return 'Z'
  }
}

